description:
Repacked collection of &quot;Ah! My Goddess&quot; anime.
Comprises the original OVA, minigoddesses, movie, first and Second TV series, specials, and sound tracks
Follows the same structure as the other (15.8GB) torrent out there (and is in fact 95.8% identical), but this one may actually complete. Main difference is replacement of episodes 23 and 24 from series 2 with ones by the same fansub group as the rest; and removing some small files that seem to fulfill no other purpose than being absent and thwart completion of torrents (such as .svf files).

The videos are Japanese with English subs; the dual-audio videos also come with English audio track (hence dual-audio).

